import ManageGrups from "../components/grup/ManageGrups";
import Grups from "../components/grup/Grups";
import Grup from "../components/grup/Grup";
import GrupAdd from "../components/grup/GrupAdd";
import GrupEdit from "../components/grup/GrupEdit";
import ManageUsers from "../components/user/ManageUsers";
import UserEdit from "../components/user/UserEdit";

const routes = [
  {
    path: "/users/:userId/edit",
    component: UserEdit,
    isPrivate: false,
  },

  {
    path: "/users",
    component: ManageUsers,
    isPrivate: false,
  },

  {
    path: "/grups/new",
    component: GrupAdd,
    isPrivate: false,
  },

  {
    path: "/grup/:grupId/edit",
    component: GrupEdit,
    isPrivate: false,
  },

  {
    path: "/grup/:grupId",
    component: Grup,
    isPrivate: false,
  },

  {
    path: "/grups",
    components: ManageGrups,
    isPrivate: false,
  },

  {
    path: "/",
    components: Grups,
    isPrivate: false,
  },
];

export default routes;
